   // Feature name : HDR ABF3 Adjustment feature
   // Applicable chipsets: 8996 and later ( supports HDR feature )
   // Applicable modes : HDR modes ( In sensor and VFE HDR )
   // ABF3 adjustment is enabled when hdr_abf_adj_enable is enabled && HDR mode is ON.
   // When this adjustment feature is enabled, VFE software driver will get aec sensitivity
   // and exposure time ratios from 3A output. Based on tuning control type, will interpolate
   // all parameters in the adjustment structure. Final adjustment factor will be multiplied with
   // ABF3 calculated params from main structure before generating HW configurations
   //
   // Variable name: enable // 1u.
   // Description: Enable flag
   // Default value: 0 (Disable by default).
   //
   // Variable name: control_hdr_abf3
   // Use Exposure Ratio or Exp time ratio to control HDR ABF3 Adjustment.
