   // Default value: 0 for bright and normal light, 1 for low light.
   // Data range: 0 to 1 (1u)
   // Effect: 0 Use same and cross channel information in BPC detection and Recovery.
   //         1 Only use same cross channel information in BPC detection and Recovery, more
   //           bad pixels (including clusters) will be removed, but more color artifacts will appear.
   //
   // Variable name: same_channel_recovery.
   // Determine if only use central pixels Same Channel
