         // Applicable chipset(s): HW version 8996 or later.
         //
         // ----- Skin-tone soft-thresholding Parameters -----
         // Variable name: skin_soft_threshold.
         // Threshold value of skin smoothing soft-thresholding.
         // Default value: 20 (8u)
         // Data range: 0 to 255.
         // Effect: Larger value includes more image structures into skin denoising
         //
         // Variable name: skin_soft_strength.
         // The smoothing strength for pixels labeled as skin-tone probability 1.
         // Default value: 1 (7uQ6)
         // Data range: 0 to 1
         // Effect: Larger value means more skin denoising.
         //
         // ----- Filtering  -----
         // The following 4 parameters are for filtering kernels.
         // The algorithm has a 7x7 filter to smooth Y for skin-tone smoothing adjustment (skin_nr_filter),
         // a 7x7 filter on Y (skin_detection_y_filter) and a 7x7 filter on chroma (skin_detection_chroma_filter) for skin-tone detection,
         // and a 1x15 filter (skin_probability_filter) to smooth skin-tone probability map.
         // Note that, 1) there are two modes for skin_detection_chroma_filter, CAC on and CAC off.
         // When CAC is on, 7x7 skin_detection_chroma_filter becomes a 3x3 low pass filter.
         // 2) all the 2D filters are implemented as separable filters in H/W. Chromatix header specifies only half of the 1D kernels,
         // where the last entry is the center coefficient.
         //
         // Variable name: skin_nr_filter[4]
         // Skin smoothing separable 7x7 luma LPF (8uQ7 Center, 7uQ7 others)
         // Default value for regions 1-2 (7x7 filter): {7, 16, 26, 30}.
         // Default value for regions 3-4 (5x5 filter): {0, 11, 31, 44}.
         // Default value for regions 5-6 (3x3 filter): {0, 0, 27, 74}.
         // Data range: All coefficients are unsigned integers.
         //
         // Variable name: skin_detection_y_filter[4] (8uQ7 Center, 7uQ7 others)
         // Skin detection separable 7x7 luma LPF.
         // Default value (7x7 filter): {7, 16, 26, 30}
         // Data range: All coefficients are unsigned integers.
         //
         // Variable name: skin_detection_chroma_filter[4] (8uQ7 Center, 7uQ7 others)
         // Skin detection separable 3x3/7x7 chroma LPF.
         // Default value for regions 1-2: (3x3 filter): {0, 0, 27, 74}.
         // Default value for regions 3-6: (7x7 filter) {7, 16, 26, 30}.
         // Data range: All coefficients are unsigned integers.
         //
         // Variable name: skin_probability_filter[8] (8uQ7 Center, 7uQ7 others)
         // 1x15 LPF of skin-tone probability.
         // Default value: {1,1,3,6,9,15,19,20}
         // Data range: All coefficients are unsigned integers.
         //
         // --------------- Skin-tone region definition Parameters  --------------------------
         // Variable name: H_min.
         // H/W takes the absolute value of min(Hue) for the pre-defined HSY skin-tone region.
         // Here S/W could use the original values for Hmin and Hmax are negative.
         // Default values: -1.5 (10uQ8)
         // Data range: -2 to 0.
         // Note: Software will program absolute value to HW.
         //
         // Variable name: H_max.
         // H/W takes the absolute value of min(Hue) for the pre-defined HSY skin-tone region.
         // Here S/W could use the original values for Hmin and Hmax are negative.
         // Default values: -0.4 (8uQ8)
         // Data range: -0.996 to 0.
         // Note: Software will program absolute value to HW.
         //
         // Variable name: Y_min, Y_max.
         // The min and max values of Y range.
         // Default values: 0.1, 0.9 (8uQ8,8uQ8)
         // Data range: 0 to 1.
         //
         // Varible name: S_hY_min, S_hY_max (8uQ8, 8uQ8)
         // When projecting the skin-tone region onto SY sub-plane, we see a quadrilateral.
         // These two variables together with the following two represent the four vertices,
         // and they are the min and max values of S on Y_max level.
         // Default values: 0.05, 0.2
         // Data range: 0 to 1.
         //
         // Varible name: S_lY_min, S_lY_max.
         // The min and max values of S on Y_min level.
         // Default values: 0.15, 0.55
         // Data range: 0 to 1.
         // Note: S/W has to convert these two parameters to Smin_para, Smax_para
         //   for H/W to avoid division.
         // Smin_para (8uQ8)=  (SlY_min - ShY_min) / (Ymax - Ymin).
         // Smax_para (8uQ8)= (SlY_max - ShY_max) / (Ymax - Ymin).
         //
