   // Feature name: Video HDR
   // Applicable chipset(s): MSM8994
   // Applicable operation mode:
   //     snapshot processing, and video modes.
   // New feature starting VFE4.6. Support interlaced HDR sensors, which have interlaced even/odd row pairs to capture long (T1) and short (T2) exposures.
   // Implemented as 2 blocks: HDR_RECON, HDR_MAC.
   // Reconstruction (RECON) block: generate two full resolution T1 and T2 frames from half resolution T1 and T2 fields, using interpolation and field merging.
   // Motion Adaptive Combine (MAC) block: combine full resolution T1 and T2 images into a linearized HDR image.
   //
   // Variable name: enable
   // Description: Video HDR module enable flag
   // Default value: 1.
