   // Region between Start and End forms interpolation Region, trigger less than
   //   start is non interpolation region.
   //
   // Variable name: module_cfg_hdr_recon_en // 1u.
   // Description: This flag when set to 1 enables HDR RECON module. Default is Disable (0).
   // Constraints: This Flag Should be enabled only for VIDEO MODE and HDR Sensors.
   // Default value: 0 (Disable).
   //
   // Variable name: module_cfg_hdr_mac_en // 1u.
