      /******************************************************************************/
      // Feature name: Dynamic Color Shading Correction 0x303 (Tintless) new version 0x303
      // Applicable chipset(s):               HW version with Rolloff and Bayer Stats module
      // Applicable operation mode:           Preview, video and snapshot
      //
      // Variable name: tintless_enable.
      // Use Dynamic Color Shading Correction or switch back to Traditional Table Selection.
      // Default value: 1.
      // Data range: 0 or 1.
      // Constraints: Rolloff and Bayer Stats HW Enabled. Bayer Stats are needed
      //              in order to use Dynamic Color Shading Correction.
      // Effect: 1 - Enable Dynamic Color Shading Correction.
      //         0 - Switch back to Traditional Table Selection
      //
      // Variable name: gain_start.
      // When gain >= gain_start, lowlight Dynamic Color Shading Correctionis interpolated
      //    with normal Dynamic Color Shading Correction.
      // Default value: N/A
      // Data range: min_gain to max_gain. Gain means digital and analog combined gain.
      // Effect: Increasing this value will use lowlight Dynamic Color Shading
      //   Correction under lower light condition.
      //
      // Variable name: gain_end.
      // When gain >= gain_end, 100% lowlight Dynamic Color Shading Correction is used.
      // Default value: N/A
      // Data range: min_gain to max_gain. Gain means digital and analog combined gain.
      // Constraint: gain_end > gain_start.
      // Effect: Increasing this value will use 100% lowlight Dynamic Color Shading Correction
      // under lower light condition.
      //
      // Variable name: lux_index_start.
      // When lux_index >= lux_index_start, lowlight Dynamic Color Shading Correction is
      //   interpolated with normal Dynamic Color Shading Correction.
      // Default value: N/A
      // Data range: For linear AFR case: 0 to max_index from exposure table.
      //             For non-linear AFR case : 0 to max_index*numberof_FPS_supported.
      // Effect: Increasing this value will use lowlight Dynamic Color Shading Correction
      //   under lower light condition.
      //
      // Variable name: lux_index_end.
      // When lux_index >= lux_index_end, 100% lowlight Dynamic Color Shading Correction is used.
      // Default value: N/A
      // Data range: For linear AFR case: 0 to max_index from exposure table.
      //             For non-linear AFR case : 0 to max_index*numberof_FPS_supported.
      // Constraint: lux_index_end > lux_index_start.
      // Effect: Increasing this value will use 100% lowlight Dynamic Color Shading Correction
      // under lower light condition.
      //
      // Variable name: tintless_threshold.
      // Determine how much color shading will be treated as tint
